Rustからリンカスクリプトのシンボルを参照することも可能です。これは、.bssセクションのゼロクリアや、.dataセクションの初期化に利用できます。 次のように、リンカスクリプトでセクションの開始位置と終了位置にシンボルを作成します。 SECTIONS
{ .bss : { _sbss = .; *(.bss .bss.*); _ebss = .; } > RAM .data : AT(ADDR(.rodata) + SIZEOF(.rodata)) { _sdata = .; *(.data .data.*); _edata = .; } > RAM _sidata = LOADADDR(.data); これらのリンカスクリプトで作成したシンボルは、Rustで次のように利用できます。これは、.bssセクションのゼロクリアと、.dataセクションの初期化を行うコードの例です。 use core::ptr; #[no_mangle]
pub unsafe extern "C" fn Reset() -> ! { // RAMの初期化 extern "C" { static mut _sbss: u8; static mut _ebss: u8; static mut _sdata: u8; static mut _edata: u8; static _sidata: u8; } let count = &_ebss as *const u8 as usize - &_sbss as *const u8 as usize; ptr::write_bytes(&mut _sbss as *mut u8, 0, count); let count = &_edata as *const u8 as usize - &_sdata as *const u8 as usize; ptr::copy_nonoverlapping(&_sidata as *const u8, &mut _sdata as *mut u8, count); loop {}
} リンカスクリプトで作成したシンボルをu8の変数として、そのアドレスを利用します。

