stableでアセンブリを書く方法は、外部ファイルに書くことです。.sファイルにアセンブリを書いておき、アセンブラを使ってオブジェクトファイル (.o) にアセンブルし、アーカイブ (.a) を作り、Rustのコードとリンクします。 この方法では、ターゲットアーキテクチャのアセンブラが必要です。例えば、ARM Cortex-Mをターゲットにする時、アセンブラとして、arm-none-eabi-gcc (arm-none-eabi-as) を使います。 Makefileを使うこともできますが、よりRustらしく、ビルドスクリプトを作成します。 cc クレートを利用し、ビルドスクリプト内でC言語 (C++やアセンブリも可) のコードをビルドします。 今、Cargoプロジェクトのトップディレクトリにアセンブリを書いたasm.sがあるとします。ビルドスクリプトは、次のようになります。 use std::{env, error::Error, fs::File, io::Write, path::PathBuf};
use cc::Build; fn main() -> Result<(), Box<Error>> { // このクレートのビルドディレクトリです let out_dir = PathBuf::from(env::var_os("OUT_DIR").unwrap()); // ライブラリサーチパスを追加します println!("cargo:rustc-link-search={}", out_dir.display()); // `link.x`をビルドディレクトリに置きます File::create(out_dir.join("link.x"))?.write_all(include_bytes!("link.x"))?; // `asm.s`ファイルをアセンブルします Build::new().file("asm.s").compile("asm"); Ok(())
} Cargo.tomlに依存関係を追加します。 [build-dependencies]
cc = "1.0.36" これだけで、外部アセンブリファイルをアセンブルし、アーカイブファイルを作り、Rustコードとリンクしてくれます。 豆知識〜ccクレートでコンパイラを指定〜 ccクレートで任意のコンパイラを使用したい場合、環境変数での設定が可能です。例えば、次のようにコマンドを実行します。 CC=/opt/toolchain/arm-none-eabi-gcc cargo build CFLAGS環境変数によるコンパイラフラグの指定も可能です。 豆知識〜ビルド生成物の配布〜 クレートと共に、あらかじめビルドした生成物を配布することができます。ccクレートを使う場合、ビルドマシンにターゲットアーキテクチャのアセンブラが必要です。クレートのユーザーのマシンに、このアセンブラがなくても、クレートを使ってもらえます。詳しいやり方は、Embedonomiconの stableでのアセンブリ を参照して下さい。

