ベアメタルプログラミングでも開発が進むと動的なコレクションが使いたくなります。stdが使える通常のRustでは、VecやStringといった一般的なコレクションが利用できます。このようなコレクションは、ヒープメモリを利用します。そのため、デフォルトでは、no_stdな環境では、これらのコレクションを利用できません。しかし、no_stdなRustでも、メモリアロケータを実装することで、コレクションを利用することができます。 メモリアロケータを実装 せず にコレクションを利用する方法は、 heapless で説明します。 ただ、(執筆時点のRust 1.35.0では) 残念なことに nightly必須です 。ベアメタルでメモリアロケータを実装するには、 alloc と alloc_error_handler のフィーチャが必要です。allocは、Rust 1.36でstableになるため、本書が世に出回っている時点では、stableになっています。一方、alloc_error_handlerについては、まだ安定化の目途が立っていないようです。今しばらく、メモリアロケータの実装はnightly専用になりそうです。 一時的にツールチェインをnightlyに切り替えます。Cortex-M3を例に解説します。nightlyのツールチェインにCortex-M3用のターゲットを追加します。 $ rustup override set nightly
$ rustup target add thumbv7m-none-eabi ここでの目標は、次のプログラムを動作させることです。 pub unsafe extern "C" fn Reset() -> ! { let mut xs = Vec::new(); xs.push(42); xs.push(83); println!("{:?}", xs);
} println!マクロの実装方法については、 print!マクロ で説明しています。

