これから、BumpPointerAllocという最も単純なアロケータを実装します。このアロケータは、次のようにヒープメモリを管理します。 初期化時に、ヒープメモリ領域の開始アドレスと終了アドレスを受け取ります 割り当て可能なメモリ領域の先頭ポインタを1つだけ保持します メモリを新しく割り当てると、割り当てた分だけ単純に先頭ポインタを増加します 一度割り当てたメモリは、解放しません 上述した通り、このアロケータは、GlobalAllocトレイトを実装します。全体を示します。 use core::ptr;
use core::cell::UnsafeCell;
use core::alloc::GlobalAlloc;
extern crate alloc;
use alloc::alloc::Layout;
use alloc::vec::Vec;
// *シングル*コアシステム用のポインタを増加するだけのアロケータ
struct BumpPointerAlloc { head: UnsafeCell<usize>, end: usize,
} unsafe impl Sync for BumpPointerAlloc {} unsafe impl GlobalAlloc for BumpPointerAlloc { unsafe fn alloc(&self, layout: Layout) -> *mut u8 { let head = self.head.get(); let align = layout.align(); let res = *head % align; let start = if res == 0 { *head } else { *head + align - res }; if start + align > self.end { // ヌルポインタはメモリ不足の状態を知らせます ptr::null_mut() } else { *head = start + align; start as *mut u8 } } unsafe fn dealloc(&self, _: *mut u8, _: Layout) { // このアロケータはメモリを解放しません }
} 順番に解説します。 struct BumpPointerAlloc { head: UnsafeCell<usize>, end: usize,
} まず、このアロケータは、割り当て可能なメモリ領域の先頭を示すheadと、末尾を示すendを持ちます。headがUnsafeCellになっている理由は、&selfを引数に取るallocメソッドの中でheadの値を書き換えるためです。allocメソッドのシグネチャは、GlobalAllocトレイトで定義されているため、引数を&mut selfに変更することができません。 unsafe impl Sync for BumpPointerAlloc {} 次にSyncトレイトを実装します。これは、グローバルアロケータのオブジェクトがstatic変数になるため、スレッド間で安全に共有できることをコンパイラに伝えるためです。 GlobalAllocトレイトの実装で求められるメソッドは、allocとdeallocのみです。deallocはメモリを解放しないため、何もしません。 unsafe fn alloc(&self, layout: Layout) -> *mut u8 { let head = self.head.get(); let align = layout.align(); let res = *head % align; let start = if res == 0 { *head } else { *head + align - res }; if start + align > self.end { // ヌルポインタはメモリ不足の状態を知らせます ptr::null_mut() } else { *head = start + align; start as *mut u8 } } 引数layout ( Layout ) は、要求されているメモリブロックです。align()で、アライメントを考慮して、確保しなければならないメモリブロックサイズを返します。headのアドレスがendに到達するまで、単純にポインタを増加しながら、メモリを割り当てます。 なお、この実装は、割り込みでメモリアロケータを使用する場合、データ競合が発生し、安全に利用 できません 。

