Rust Embedded devices WGでもRTOSとRustとのインテグレーションは issue #62 で議論中です。 ここでは、Cで作られたRTOSである Zephyr をターゲットに、RTOSとのインテグレーションを実験してみます。ZephyrのAPIを利用して、Rustからprintln!マクロを使って、コンソールに文字を出力します。また、RTOSのような複雑なCプロジェクトとのインテグレーションが困難な理由を考察します。 そのために、次のことができるようにします。 CからRustのAPIを呼び出す RustからZephyrのAPIを呼び出す 双方のバインディングは、cbindgenおよびbindgenを用いて自動生成します。ここで掲載する方法には、まだまだ改善の余地があることに注意して下さい。 次のコードが動くようにします。 #include <rustlib.h> int main(void) { rust_main();
} まずC言語から、Rustのrust_main関数を呼び出します。バインディング用のヘッダファイルrustlib.hはcbindgenで自動生成します。 #[no_mangle]
pub extern "C" fn rust_main() { println!("Hello {}", "Rust");
} Rustにはprintln!マクロを実装します。このprintln!マクロは、ZephyrのAPIを利用してコンソールに文字列を出力します。Zephyr APIのバインディングは、bindgenで自動生成します。 最終的に、C (main) → Rust (rust_main) → C (Zephyr API)というコールグラフになります。

